script: |
  super -f tsv -I q11332.sql | sort > q11332.out

vector: true

inputs:
  - name: q11332.sql
    data: |
      SELECT - 81 AS col2, + 46 + - COUNT ( + col1 ) AS col1 FROM tab1 WHERE NULL NOT IN ( + - CAST ( NULL AS INTEGER ) + 94, - ( - col0 ) * col1 + + 46 + - col1 + + col2, - 16 );
  - name: tab1

outputs:
  - name: q11332.out
    data: |
      -81	46
